import React, { useState, useEffect } from 'react'

import { Map, Marker, GoogleApiWrapper } from 'google-maps-react'

import './css/GoogleMap.scss'

const GoogleMap = (props) => {

    let map

    const [mapStyle, setMapStyle] = useState([])

    const drawMarker = () => {
        const state = {
            cords: [
                {latitude: 51.54015818523244, longitude: 5.995251772262631}
            ]
        }

        return state.cords.map((store, i) => {
        return <Marker key={i} id={i} position={{
            lat: store.latitude,
            lng: store.longitude
        }}

        onClick={() => console.log("Event Hanlder Called")} />
        })
    }

    useEffect(() => {
        /* drawMarker() */
        map = document.getElementById("map")
    })

    return (
        <>
            <div
                id='map'
            >
                <Map
                    id='map'
                    google={props.google}
                    options={{ mapId: "dbb29a4f0be1f983" }}
                    zoom={15}
                    initialCenter={{ 
                        lat: 51.54015818523244, 
                        lng: 5.995251772262631
                    }}>
                    {/* {drawMarker()} */}
                </Map>
            </div>
        </>
    )
}

export default GoogleApiWrapper({
    apiKey: 'AIzaSyAtP9KGxPuB9C1sFEJqa9DDHSNn5UNLssI'
  })(GoogleMap)
